import React  from 'react';
import './App.css';
import Stopwatch  from './component/watch';
import Eventhandler from './component/eventhandler';
import Counter from './component/counter';
import Ref from './component/ref';
import Bform from './component/bform';
import Nameform from './component/dform';
import Fancyform from './component/fancyform';
import Listitem from './component/List';

import { Switch, Route, Redirect, useEffect } from "react-router";

function App() {

  return (
    <div className="App">
      <Eventhandler/>
      <Stopwatch/>
      <Counter/>
      <Ref/>
      <Bform/>
      <Nameform
       getErrorMessage={value => {
        if (value.length < 3) {
          return `Value must be at least 3 characters, but is only ${value.length}`
        }
        if (!value.includes('s')) {
          return `Value does not include "s" but it should!`
        }
        return null
      }}
      />
      <Fancyform/>
      <Listitem/>
      <Switch>
        <Route exact path="/Eventhandler" component={Eventhandler} />
        <Route exact path="/Stopwatch" component={Stopwatch} />
        <Route exact path="/Appdevlopment" component={Appdevlopment} />
        <Route exact path="/About" component={About} />
        <Route exact path="/Career" component={Career} />
        <Route exact path="/Testimonial" component={Testimonial} />
        <Route exact path="/Jobapplay" component={Jobapplay} />
        <Route exact path="/Contectus" component={Contectus} />
        <Route exact path="/Qatesting" component={Qatesting} />
        <Route exact path="/Uiux" component={Uiux} />
        <Route exact path="/Team" component={Team} />
        <Route exact path="/Portfolio" component={Portfolio} />
        <Route exact path="/WebsiteDevlopment" component={WebsiteDevlopment} />

        </Switch>
    </div>
  );
}

export default App;
